import styled from "styled-components";

export default function Header() {
  return (
    <HeaderWrapper>
      <HeaderTitle>자취생은 매일매일 점심이 고민이다</HeaderTitle>
    </HeaderWrapper>
  );
}

const HeaderWrapper = styled.header`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
`;

const HeaderTitle = styled.h1``;
